window.bookSummaryJSON = "<p><b>Meet Quinn MacKenna, a black magic arms dealer from the mean streets of Boston. </b></p> <p>Everything was going fine for Quinn…until she accidentally stole from Nate Temple. </p> <p>She knows how to drink, fight, and steal dangerous magical artifacts - but not for money. For favors. Because all her life she’s wanted only one thing - a secret so dangerous and well-guarded that no one will give it up. </p> <p>A ticket to the Land of the Fae so she can find her dad and finally get some answers about her past. </p> <p>So she doesn’t ask questions of her clients, only favors, hoping that they will eventually add up to get her what she so desperately desires. And with her unique ability to nullify magic, the world’s deadliest artifacts - or the clients who demand them - don’t really impress her very much. </p> <p>But that all changes when she accidentally robs the infamous Nate Temple, and finds herself in a much deeper world of monsters and conspiracies than she ever knew existed. Because Nate Temple and his friends aren’t the only things to be afraid of. </p> <p>Now she has to worry about his <i>enemies</i>, too....</p> <p>The newest antihero in the worldwide best-selling Nate Temple Universe by Shayne Silvers. Join Cameron O’Connell and Shayne at the literary bar to sip a dirty cocktail of feisty Irish brogue - with an unhealthy splash of monsters - <i>today</i>!</p> <p>If you like KF Breene, Shannon Mayer, CN Crawford, Ilona Andrews, or Patricia Briggs, you will <b><i>love</i></b> the <i>first </i>installment of the Phantom Queen Diaries.</p> <p><i>*Over half a million readers have been pleasured by the Temple Verse novels. Now it’s your turn....*</i></p>"; 
